  input: TEXT,SA11A1,SA11A1.10418,"Leadership PAC 2006 received this contribution
    in November 2006.  The PAC has attemtped Best Efforts to obtain the required information
    for this contribution.  The first steps were taken in October 2005 when the original
    written solicitation materials were sent out.  Those materials included a form
    requesting collection of the name, mailing address, occurpation and the name of
    the employer of individuals whose contributions exceed $200 in a calendar year.  The
    PAC does have the contributors address.  In an effort to obtain the additional
    required information, the PAC made at least 4 phone calls to the Ohio Center for
    Broadcasting, which is located at the same address as M&S Media Partnership.  Of
    those calls, one call was returned to the PAC informing us that they would contact
    their lawyers to try to obtain the names of those in the partnership and the appropriate
    attribution for each, where applicable.  The PAC, as of 2/17/06, has not received
    that information.  If the information is obtained the PAC will amend this report
    accordingly. However, if the PAC is unable to obtain this information by 2/28/06,
    the funds will be returned to M&S Media Partnership."
